import reacticon from "../assets/img/icon/reacticon.png";
import sassicon from "../assets/img/icon/sassicon.png";
import { Col, Container, Row } from "react-bootstrap";
import img1 from "../assets/img/Baymish/1.jpg";
import img2 from "../assets/img/Baymish/2.jpg";
import img3 from "../assets/img/Baymish/3.jpg";
import { MDBCarousel, MDBCarouselItem } from "mdb-react-ui-kit";
function BaymishProject() {
  return (
    <>
      <Row className="d-flex  align-items-center ">
        <h2 className="myTextWhite d-flex fw-bolder justify-content-center my-4">
          My Projects:
        </h2>
        <h5 className="myTextRed d-flex fw-bolder justify-content-center">
          {" "}
          Grafic Design{" "}
        </h5>{" "}
        <Col xs={12} lg={6} className=" d-flex align-items-center flex-column">
          <h3> carosello</h3>
          <MDBCarousel>
            <MDBCarouselItem
              className="w-100 d-block"
              itemId={1}
              src={img1}
              alt="..."
            />
            <MDBCarouselItem
              className="w-100 d-block"
              itemId={2}
              src={img2}
              alt="..."
            />
            <MDBCarouselItem
              className="w-100 d-block"
              itemId={3}
              src={img3}
              alt="..."
            />
          </MDBCarousel>{" "}
        </Col>
        <Col>
          <h2 className="myTextBlu fw-bolder"> Silv</h2>
          <p className="px-5 mx-5 myTextWhite ">
            Lorem ipsum dolor sit amet consectetur adipisicing elit.
            Perspiciatis ea architecto odio omnis quibusdam nulla dolor
            dignissimos similique deleniti, quam illum earum obcaecati eveniet,
            temporibus rerum modi ratione, commodi praesentium!
          </p>
        </Col>
      </Row>
    </>
  );
}

export default BaymishProject;
